import React from "react";
import styled, { keyframes } from "styled-components/macro";
import { Section } from "../components";

/* ========== animations ========== */
const fadeUp = keyframes`
  from { opacity: 0; transform: translateY(8px) }
  to   { opacity: 1; transform: translateY(0) }
`;
const popIn = keyframes`
  0% { opacity: 0; transform: scale(.96) translateY(6px) }
  100%{ opacity: 1; transform: scale(1) translateY(0) }
`;
const floatY = keyframes`
  0%,100% { transform: translateY(0) }
  50%     { transform: translateY(-6px) }
`;
const shimmer = keyframes`
  0%   { background-position: -200% 0 }
  100% { background-position: 200% 0 }
`;
const growBar = keyframes`
  from { width: 0 }
  to   { width: var(--to, 60%) }
`;
const dot = keyframes`
  0%, 20%  { transform: translateY(0); opacity: .5 }
  50%      { transform: translateY(-3px); opacity: 1 }
  100%     { transform: translateY(0); opacity: .5 }
`;

/* ========== layout ========== */
const FullBleed = styled(Section.InnerContainer)`
  width: 100%;
  max-width: none;
  padding: clamp(48px, 8vw, 96px) clamp(16px, 3vw, 32px);
`;

const Hero = styled.div`
  display: grid;
  grid-template-columns: 1.2fr 1fr;
  gap: clamp(24px, 4vw, 48px);
  align-items: center;

  @media (max-width: 980px) {
    grid-template-columns: 1fr;
  }
`;

const Copy = styled.div``;

const Eyebrow = styled.p`
  font-weight: 700;
  letter-spacing: .06em;
  text-transform: uppercase;
  color: var(--bs-primary, #2563eb);
  margin: 0 0 6px;
  animation: ${fadeUp} .5s ease both;
`;

const Title = styled.h2`
  margin: 0 0 10px;
  font-size: clamp(28px, 4vw, 42px);
  line-height: 1.15;
  color: var(--bs-gray-900, #111);
  animation: ${fadeUp} .6s ease both .05s;
`;

const Lead = styled.p`
  margin: 10px 0 18px;
  max-width: 65ch;
  font-size: 1.1rem;
  line-height: 1.7;
  color: var(--bs-gray-700, #4b5563);
  animation: ${fadeUp} .6s ease both .1s;
`;

const Highlights = styled.ul`
  list-style: none;
  padding: 0;
  margin: 12px 0 0;
  display: flex;
  flex-wrap: wrap;
  gap: 10px;
`;

const Chip = styled.li`
  display: inline-flex;
  align-items: center;
  gap: 8px;
  padding: 10px 12px;
  border-radius: 999px;
  background: #fff;
  border: 1px solid rgba(0,0,0,.08);
  color: var(--bs-gray-900, #111);
  font-weight: 600;
  font-size: .95rem;
  animation: ${popIn} .35s ease both;
  &:nth-child(1){ animation-delay: .05s }
  &:nth-child(2){ animation-delay: .1s }
  &:nth-child(3){ animation-delay: .15s }
  &:nth-child(4){ animation-delay: .2s }
  &:nth-child(5){ animation-delay: .25s }
  &:nth-child(6){ animation-delay: .3s }
`;

/* ========== animated right panel ========== */
const Panel = styled.div`
  position: relative;
  height: clamp(300px, 36vw, 460px);
  border-radius: 20px;
  background:
    radial-gradient(120% 120% at 10% 0%, rgba(37,99,235,.15), transparent 50%),
    radial-gradient(120% 120% at 90% 100%, rgba(16,185,129,.15), transparent 50%),
    linear-gradient(180deg, #ffffff, #f8fafc);
  box-shadow: 0 20px 40px rgba(0,0,0,.08);
  border: 1px solid rgba(0,0,0,.06);
  overflow: hidden;
  padding: clamp(14px, 2vw, 18px);
  display: grid;
  place-items: center;
`;

const PanelGrid = styled.div`
  width: 100%;
  max-width: 560px;
  display: grid;
  grid-template-columns: 1.1fr .9fr;
  gap: 14px;

  @media (max-width: 520px) {
    grid-template-columns: 1fr;
  }
`;

/* ---- property preview (left) ---- */
const Preview = styled.div`
  background: #fff;
  border-radius: 16px;
  border: 1px solid rgba(0,0,0,.06);
  box-shadow: 0 10px 20px rgba(0,0,0,.06);
  overflow: hidden;
  animation: ${fadeUp} .5s ease both;
`;

const PreviewImage = styled.div`
  aspect-ratio: 4 / 3;
  background-image:
    linear-gradient(90deg, rgba(255,255,255,0) 0%, rgba(255,255,255,.6) 50%, rgba(255,255,255,0) 100%),
    linear-gradient(180deg, #c7d2fe, #d1fae5);
  background-size: 200% 100%, cover;
  background-position: 0 0, center;
  animation: ${shimmer} 2.6s linear infinite,
             ${floatY} 6s ease-in-out infinite;
  position: relative;
`;

const Pin = styled.div`
  position: absolute;
  right: 16px; bottom: 12px;
  background: #fff;
  border: 1px solid rgba(0,0,0,.08);
  border-radius: 12px;
  padding: 6px 10px;
  font-size: .9rem;
  font-weight: 700;
  box-shadow: 0 8px 18px rgba(0,0,0,.08);
`;

const PreviewMeta = styled.div`
  padding: 12px 14px 14px;
  h4 {
    margin: 0 0 4px;
    font-size: 1.05rem;
    color: var(--bs-gray-900, #111);
  }
  p {
    margin: 0;
    color: var(--bs-gray-700, #4b5563);
    font-size: .95rem;
  }
`;

/* ---- chat-style message (right) ---- */
const Chat = styled.div`
  background: rgba(255,255,255,.9);
  backdrop-filter: blur(6px);
  border-radius: 16px;
  border: 1px solid rgba(0,0,0,.06);
  box-shadow: 0 10px 20px rgba(0,0,0,.06);
  padding: 14px;
  display: grid;
  gap: 10px;
  animation: ${fadeUp} .6s ease both .05s;
`;

const ChatHeader = styled.div`
  display: flex;
  align-items: center;
  gap: 10px;
`;
const Avatar = styled.div`
  width: 38px; height: 38px; border-radius: 50%;
  display: grid; place-items: center;
  background: #e0e7ff; font-weight: 800;
`;
const Agent = styled.div`
  font-weight: 700; color: var(--bs-gray-900, #111);
  small { display:block; font-weight: 500; color: var(--bs-gray-600,#6b7280) }
`;

const Bubble = styled.div`
  border-radius: 14px;
  background: #fff;
  border: 1px solid rgba(0,0,0,.06);
  padding: 12px 14px;
  line-height: 1.55;
  color: var(--bs-gray-800, #1f2937);
  animation: ${popIn} .35s ease both .15s;
`;

const Typing = styled.div`
  display: inline-flex; align-items: center; gap: 4px;
  .dot {
    width: 6px; height: 6px; border-radius: 50%; background: #9aa4b2;
    animation: ${dot} 1.2s ease-in-out infinite;
  }
  .dot:nth-child(2){ animation-delay: .15s }
  .dot:nth-child(3){ animation-delay: .3s }
`;

const MetaId = styled.small`
  color: var(--bs-gray-600, #6b7280);
`;

/* ---- tiny market bars under message ---- */
const Snapshot = styled.div`
  display: grid; gap: 8px; margin-top: 4px;
`;
const Row = styled.div`
  display: grid; grid-template-columns: 1fr auto; gap: 8px; align-items: center;
  font-size: .92rem;
  strong { color: var(--bs-gray-900, #111) }
  span   { color: var(--bs-gray-600, #6b7280) }
`;
const Bar = styled.div`
  height: 8px; background: rgba(0,0,0,.06); border-radius: 6px; overflow: hidden;
  > i { display:block; height:100%; width:0; background: linear-gradient(90deg,#93c5fd,#6ee7b7);
       animation: ${growBar} 1.2s ease forwards; animation-delay: .2s; }
`;

/* ---- features + stats below ---- */
const Grid = styled.div`
  margin-top: clamp(28px, 4vw, 44px);
  display: grid;
  grid-template-columns: repeat(auto-fill, minmax(280px, 1fr));
  gap: 18px;
`;

const Card = styled.div`
  background: #fff;
  border-radius: 16px;
  box-shadow: 0 10px 24px rgba(0,0,0,.06);
  border: 1px solid rgba(0,0,0,.05);
  padding: 22px 22px 20px;
  transition: transform .15s ease, box-shadow .15s ease;
  animation: ${fadeUp} .5s ease both;
  &:hover { transform: translateY(-2px); box-shadow: 0 18px 36px rgba(0,0,0,.08); }
  h3 { margin: 0 0 8px; font-size: 1.15rem; font-weight: 700; color: var(--bs-gray-900, #111); }
  p  { margin: 0; color: var(--bs-gray-700, #4b5563); line-height: 1.65; }
`;

const Stats = styled.div`
  margin-top: 22px;
  display: grid;
  grid-template-columns: repeat(3, minmax(0, 1fr));
  gap: 12px;
  @media (max-width: 640px) { grid-template-columns: 1fr 1fr; }
`;

const Stat = styled.div`
  background: #fff;
  border: 1px solid rgba(0,0,0,.06);
  border-radius: 14px;
  padding: 16px;
  text-align: center;
  animation: ${fadeUp} .5s ease both .1s;
  strong { display:block; font-size: 1.35rem; }
  span { color: var(--bs-gray-600, #6b7280); }
`;

/* ========== component ========== */
const HomeContactContainer = () => {
  return (
    <Section bgColor="--bs-fade-blue">
      <FullBleed>
        <Hero>
          <Copy>
            <Eyebrow>About the platform</Eyebrow>
            <Title>Everything you need to find your next home</Title>
            <Lead>
              Real Home simplifies buying, renting, and listing properties with verified
              data, rich neighborhood details, and a modern, map-first experience. Built for speed,
              clarity, and trust across the MENA region.
            </Lead>

            <Highlights>
              <Chip>✅ Verified listings</Chip>
              <Chip>🔎 Smart filters</Chip>
              <Chip>🗺️ Real-time map view</Chip>
              <Chip>🏷️ Transparent pricing & fees</Chip>
              <Chip>⭐ Save & compare</Chip>
              <Chip>🌙 Light & dark themes</Chip>
            </Highlights>
          </Copy>

          {/* Animated, pretty, info-only panel */}
          <Panel>
            <PanelGrid>
              <Preview>
                <PreviewImage>
                  <Pin>Amman • Abdoun</Pin>
                </PreviewImage>
                <PreviewMeta>
                  <h4>3-Bedroom Apartment • New Listing</h4>
                  <p>125 m² • 2 Baths • Balcony • Elevator • Parking</p>
                </PreviewMeta>
              </Preview>

              <Chat aria-live="polite">
                <ChatHeader>
                  <Avatar>RH</Avatar>
                  <Agent>
                    Agent Layla
                    <small>Real Home Support</small>
                  </Agent>
                </ChatHeader>

                <Bubble>
                  Hi Alaa! The Abdoun 3BR you saved is available today.
                  Photos were updated this morning and the price is negotiable.
                  <br />
                  <MetaId>Message ID: RH-4921</MetaId>
                </Bubble>

                <Typing>
                  <span className="dot" />
                  <span className="dot" />
                  <span className="dot" />
                </Typing>

                <Snapshot>
                  <Row>
                    <span>Avg. rent (Amman)</span>
                    <strong>JOD 450</strong>
                  </Row>
                  <Bar style={{ ["--to"]: "55%" }}><i /></Bar>

                  <Row>
                    <span>New listings this week</span>
                    <strong>+238</strong>
                  </Row>
                  <Bar style={{ ["--to"]: "70%" }}><i /></Bar>
                </Snapshot>
              </Chat>
            </PanelGrid>
          </Panel>
        </Hero>

        <Grid>
          <Card style={{ animationDelay: ".05s" }}>
            <h3>Accurate, Fresh Data</h3>
            <p>Listings are validated and refreshed frequently to keep prices, availability, and photos up to date.</p>
          </Card>
          <Card style={{ animationDelay: ".1s" }}>
            <h3>Powerful Search</h3>
            <p>Filter by city, price, bedrooms, amenities, and more—then explore results on an interactive map.</p>
          </Card>
          <Card style={{ animationDelay: ".15s" }}>
            <h3>Neighborhood Insights</h3>
            <p>Understand commute times, nearby schools, services, and community vibes before you visit.</p>
          </Card>
          <Card style={{ animationDelay: ".2s" }}>
            <h3>Saved Collections</h3>
            <p>Organize favorites into lists, add notes, and compare options side-by-side to decide confidently.</p>
          </Card>
          <Card style={{ animationDelay: ".25s" }}>
            <h3>Clear Costs</h3>
            <p>Breakdowns for rent/sale price, deposits, utilities, and expected monthly totals—no surprises.</p>
          </Card>
          <Card style={{ animationDelay: ".3s" }}>
            <h3>Privacy & Security</h3>
            <p>Modern authentication and secure data handling keep your account and personal info protected.</p>
          </Card>
        </Grid>

        <Stats>
          <Stat><strong>20+ cities</strong><span>Active coverage</span></Stat>
          <Stat><strong>4.9/5</strong><span>User satisfaction</span></Stat>
          <Stat><strong>10k+</strong><span>Successful moves</span></Stat>
        </Stats>
      </FullBleed>
    </Section>
  );
};

export default HomeContactContainer;
